import React from 'react';
import { View } from 'react-native';
import Svg, { Polygon } from 'react-native-svg';

const PyramidShape = () => {
  const strokeProps = {
    stroke: "yellow",
    strokeWidth: "1"
  };

  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', backgroundColor: '#000' }}>
      <Svg height="200" width="200" viewBox="0 0 100 100">
        {/* Front face */}
        <Polygon
          points="50,20 30,80 70,80"
          fill="#FF6B6B"
          {...strokeProps}
        />

        {/* Right face */}
        <Polygon
          points="50,20 70,80 85,65"
          fill="#4ECDC4"
          {...strokeProps}
        />

        {/* Left face */}
        <Polygon
          points="50,20 15,65 30,80"
          fill="#45B7D1"
          {...strokeProps}
        />

        {/* Base (optional, visible if pyramid is "floating") */}
        <Polygon
          points="30,80 70,80 85,65 15,65"
          fill="#96CEB4"
          fillOpacity="0.5"
          {...strokeProps}
        />
      </Svg>
    </View>
  );
};

export default PyramidShape;
